const Form = () => {
  return (
    <div>
      <form>
        <label htmlFor="email">Email</label> <input type="email" />
        <label htmlFor="pass"></label> <input type="text" />
        <button type="submit">Login</button>
      </form>
    </div>
  );
};

export default Form;
